import { Statistic, Card, Row, Col,message } from 'antd';
import { TeamOutlined, HomeOutlined,EnvironmentOutlined,UsergroupAddOutlined,CarOutlined } from '@ant-design/icons';
import { useEffect, useState } from "react";
import {Admin } from '../../../services/api'
import '../../../App.css'



function Dashboard() {


  const [statistics, setStatistics] = useState();
  const [mounted, setMounted] = useState(true);


  const getStatistics = async () => {
    try {

      const response = await Admin.getStatistics();
      const newResponse = response.data;
      console.log("newResponse", newResponse);
      setStatistics(newResponse);

    } catch (error) {
      message.error(error.message);
      console.log(error.message);
    }
  };

  useEffect(() => {
    if (mounted === true) {
      getStatistics();
      console.log('statis', statistics);
    }
    return () => {
      setMounted(false);
    };
  }, [setMounted]);


  return (
    
    <div style={{

        padding: '10px',
        margin :'0px',
        textAlign:'center'
    }}>


    <Row gutter={16}>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow: '5px 10px 8px #888888'}}>
          <h5 style={{color:"white"}}>Total Users</h5>
          <Statistic
              value={statistics?.students || 2}
            valueStyle={{ color: '#3f8600' }}
            prefix={<TeamOutlined />}
            
          />
        </Card>
      </Col>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow: '5px 10px 8px #888888'}}>
        <h5 style={{color:"white"}}>Total Items</h5>
          <Statistic
            value={statistics?.drivers||20}
            
            valueStyle={{ color: '#3f8600' }}
            prefix={<UsergroupAddOutlined />}
            
          />
        </Card>
      </Col>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow: '5px 10px 8px #888888'}}>
        <h5 style={{color:"white"}}>Total Stock</h5>
          <Statistic

              value={statistics?.buses || 20}
            
              valueStyle={{ color: 'white' }}
            prefix={<CarOutlined />}
            
          />
        </Card>
      </Col>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow: '5px 10px 8px #888888'}}>
        <h5 style={{color:"white"}}>Total Profit</h5>
          <Statistic
              value={statistics?.routes || 20}
            
            valueStyle={{ color: '#3f8600' }}
            prefix={<EnvironmentOutlined />}
            
          />
        </Card>
      </Col>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow: '5px 10px 8px #888888'}}>
        <h5 style={{color:"white"}}>Total Loss</h5>
          <Statistic

              value={statistics?.departments || 20}
            
            valueStyle={{ color: '#cf1322' }}
            prefix={<HomeOutlined />}
            
          />
        </Card>
      </Col>
      <Col span={12}>
          <Card style={{ backgroundColor: "#240046", boxShadow:'5px 10px 8px #888888'}}>
        <h5 style={{color:"white"}}>Total Earning</h5>
          <Statistic
 
              value={statistics?.supports || 20}
            
            valueStyle={{ color: '#cf1322' }}
            prefix={<HomeOutlined />}
            
          />
        </Card>
      </Col>
    </Row>
  </div>
  );
}

export default Dashboard;
